"use client"

import { ColumnDef } from "@tanstack/react-table"

import { MoreHorizontal } from "lucide-react"
 
import { Button } from "../../components/ui/button"

import { Input } from "../../components/ui/input"; // Import ShadCN Input

import {
  DropdownMenu,
  DropdownMenuContent,
  DropdownMenuItem,
  DropdownMenuLabel,
  DropdownMenuSeparator,
  DropdownMenuTrigger,
} from "../../components/ui/dropdown-menu"

// This type is used to define the shape of our data.
// You can use a Zod schema here if you want.
export type AppointmentEntry = {
  id: string
  doctor: string
  reason_for_appointment: string,
  treatment: string,
  date: Date,
  allergies: string,
  conditions: string,
  medications: string,
  immunizations: string,
  procedures: string
}

export const columns: ColumnDef<AppointmentEntry>[] = [
  {
    accessorKey: "id",
    header: "Appointment ID",
  },
  {
    accessorKey: "doctor",
    header: "Doctor",
  },
  {
    accessorKey: "reason_for_appointment",
    header: "Reason for Appointment",
  },
  {
    accessorKey: "treatment",
    header: "Treatment",
  },
  {
    accessorKey: "date",
    header: "Date",
  },
  {
    accessorKey: "allergies",
    header: "Allergies",
  },
  {
    accessorKey: "conditions",
    header: "Conditions",
  },
  {
    accessorKey: "medications",
    header: "Medications",
  },
  {
    accessorKey: "immunizations",
    header: "Immunizations",
  },
  {
    accessorKey: "procedures",
    header: "Procedures",
  },
  {
    header: "Modify Appointment",
    id: "actions",
    cell: ({ row }) => {
      const payment = row.original
 
      return (
        <DropdownMenu>
          <DropdownMenuTrigger asChild>
            <Button variant="ghost" className="h-8 w-8 p-0">
              <MoreHorizontal className="h-4 w-4" />
            </Button>
          </DropdownMenuTrigger>
          <DropdownMenuContent align="end">
            <DropdownMenuLabel>Actions</DropdownMenuLabel>
            <DropdownMenuItem
              onClick={() => navigator.clipboard.writeText(payment.id)}
            >
              Copy payment ID
            </DropdownMenuItem>
            <DropdownMenuSeparator />
            <DropdownMenuItem>View customer</DropdownMenuItem>
            <DropdownMenuItem>View payment details</DropdownMenuItem>
          </DropdownMenuContent>
        </DropdownMenu>
      )
    },
  },
]
